<!DOCTYPE html>
<html>
  <head>
    <style>
         @import url('https://fonts.googleapis.com/css2?family=Caveat:wght@400..700&display=swap');
         html{height:100%;width:100%;}
         body{
             height:100%;
             width:100%;
             overflow:hidden;
             background-image:url("https://i.giphy.com/media/v1.Y2lkPTc5MGI3NjExYmh6aXhicmpnZDh2OGFkZGM1bXdveWZsM2J0cGRyOHJnMjA3azlibiZlcD12MV9pbnRlcm5hbF9naWZfYnlfaWQmY3Q9Zw/H28dEOCodna9MxkfaJ/giphy.gif");
             background-size: cover;
         }
         .cat{
             display:block;
             height:95%;
              position: absolute;
           top: 100%;
           left: 50%;
           transform: translate(-50%, -100%);
         }

        #dino{
          position:absolute;
          right:0px;
          bottom:0px;
          max-width:50%;
          max-height:50%;
        }
         #name {
      font-family: "Caveat", cursive;
      position: absolute;
      width: 100%; height: 100%;
         }
         #name text {
      text-transform: uppercase;
      animation: stroke 5s infinite alternate;
      stroke-width: 2;
      stroke: #365fa0;
      font-size: 190px;
      transform: rotate(-5deg);
         }

         @keyframes stroke {
             0%   {
                 fill: rgba(72,138,20,0); stroke: rgba(54,95,160,1);
                 stroke-dashoffset: 25%; stroke-dasharray: 0 50%; stroke-width: 4;
             }
             50%  {fill: rgba(72,138,20,0); stroke: rgba(54,95,160,1); }
             80%  {fill: rgba(72,138,20,0); stroke: rgba(54,95,160,1); stroke-width: 5; }
             100% {
                 fill: rgba(72,138,204,1); stroke: rgba(54,95,160,0);
                 stroke-dashoffset: -25%; stroke-dasharray: 50% 0; stroke-width: 5;
             }
         }

        @media only screen and (max-width: 600px) {
            .cat{
             display:block;
             width:90%;
              position: absolute;
           top: 100%;
           left: 50%;
           transform: translate(-50%, -100%);
         }
        }
    </style>
  </head>
